Movie Info: Idukki Gold is a 2013 Malayalam-language Indian feature film directed by Aashiq Abu, starring Vijayaraghavan, Pratap Pothen, Raveendran, Babu Antony and Maniyanpilla Raju, based on Santhosh Echikkanam's short story of the same name. The film is released on October 11, 2013 

